  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/product/:id" element={<ProductScreen />} />
          <Route path="/" element={<Home />} exact></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
